DROP TABLE transtats;
CREATE TABLE transtats(
   FL_DATE               DATE  NOT NULL PRIMARY KEY
  ,UNIQUE_CARRIER        VARCHAR(2) NOT NULL
  ,AIRLINE_ID            INTEGER  NOT NULL
  ,CARRIER               VARCHAR(2) NOT NULL
