  ,ARR_DELAY             INTEGER  NOT NULL
  ,DISTANCE              INTEGER  NOT NULL
  ,CARRIER_DELAY         INTEGER
  ,WEATHER_DELAY         INTEGER
  ,NAS_DELAY             INTEGER
  ,SECURITY_DELAY        INTEGER
  ,LATE_AIRCRAFT_DELAY   INTEGER
);

